import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // Import your CSS file
import busImage from 'Landing/dubhackbaddies/src/images/busOne.jpg'; // Import or specify the path to your background image

function Gallery() {
  const backgroundStyle = {
    backgroundImage: `url(${busImage})`, // Use the imported image or specified path
    backgroundSize: 'cover', // Adjust the size as needed
    backgroundRepeat: 'no-repeat', // Prevent image repeating
    minHeight: '100vh', // Ensure the section covers the viewport height
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    color: 'white', // Text color
    textAlign: 'center',
  };

  return (
    <div style={backgroundStyle} className="background-section">
      <h1>Welcome to UW Bus Buddies - Connecting Commuters!</h1>
      <p>Join us to find your commuting buddy.</p>
      <h2>Who We Are</h2>
      <p>We are...</p>
      <h2>Join Us</h2>
      <Link to="/signin"> {/* Link to the sign-in page */}
        <button className="btn btn-primary">Sign In</button>
      </Link>
    </div>
  );
}

export default Gallery;
